<script setup lang="ts">
// 定义组件属性
interface Props {
    size?: string | number
    color?: string
}

// 设置默认值
const props = withDefaults(defineProps<Props>(), {
    size: 24,
    color: '#2c2c2c'
})

// 计算宽高，保持原始视窗比例（796 x 446）
import { computed } from 'vue'

const width = computed(() => props.size)

const height = computed(() => {
    const s = props.size
    // 如果是数字，按比例计算高度
    if (typeof s === 'number') {
        return Math.round(s * 446 / 796)
    }
    // 如果是像 '24px' 的字符串，解析后计算并附带单位
    if (typeof s === 'string') {
        const m = s.match(/^([0-9]+(?:\.[0-9]+)?)(px)?$/)
        if (m) {
            const n = parseFloat(m[1])
            const h = Math.round(n * 446 / 796)
            return m[2] ? `${h}px` : `${h}`
        }
    }
    // 其它字符串（例如 '1.5em' 等）不强行计算，省略 height 让浏览器按 viewBox 自动处理
    return undefined
})
</script>

